	(403, 'nimble_api_news_data', 'a:4:{i:0;a:4:{s:5:"title";s:74:"⭐️ Menu improvements in Customizr free v4.2.4 and Customizr Pro v2.2.4";s:7:"excerpt";s:366:"Dear Customizr theme users, This new version fixes two issues on mobile devices menu. We&#8217;ve also strengthened the masonry grid javascript. The latest version of Customizr Pro and free themes are fully compatible with the latest version of WordPress v5.4. Changelog fixed : [Horizontal Menus] submenu expansion on click is broken fixed : [Menus] make [&hellip;]";s:7:"created";s:19:"2020-04-14 19:12:23";s:3:"url";s:95:"https://presscustomizr.com/menu-improvements-in-customizr-free-v4-2-2-and-customizr-pro-v2-2-2/";}i:1;a:4:{s:5:"title";s:69:"Nimble Builder integrates with Yoast SEO\'s content analysis tool 🔎";s:7:"excerpt";s:397:"Dear Nimble Builder users, Following the significant improvements in page load performances, the latest release ( v2.0.6 ) now integrates Nimble Builder&#8217;s content in Yoast SEO&#8217;s content analysis tool. Yoast is the company behing WordPress SEO, used by millions, the most popular Search Engine Optimization plugin in the WordPress ecosystem. Their content analysis tool helps [&hellip;]";s:7:"created";s:19:"2020-04-14 18:54:17";s:3:"url";s:91:"https://presscustomizr.com/nimble-builder-integrates-with-yoast-seos-content-analysis-tool/";}i:2;a:4:{s:5:"title";s:76:"⚡️ performance improvements in Customizr v4.2.1 and Customizr Pro v2.2.1";s:7:"excerpt";s:339:"Dear Customizr theme users, The latest version of Customizr Pro and free themes are fully compatible with the upcoming WordPress release ( v5.4 ). Two new performance options have been added in the live customizer to limit render blocking issues. This is the first step in a series of performance improvements that will be added [&hellip;]";s:7:"created";s:19:"2020-03-19 16:42:25";s:3:"url";s:116:"https://presscustomizr.com/%e2%9a%a1%ef%b8%8f-performance-improvements-in-customizr-v4-2-1-and-customizr-pro-v2-2-1/";}i:3;a:4:{s:5: