	(664, 'wpmembers_dialogs', 'a:9:{s:14:"restricted_msg";s:308:"Контент доступен только для пользователей сайта. Если вы уже являетесь пользователем, пожалуйста, войдите в систему. Новые пользователи могут зарегистрироваться ниже.";s:4:"user";s:127:"Извините, это имя пользователя занято, пожалуйста, попробуйте другое.";s:5:"email";s:152:"Извините, этот адрес электронной почты уже есть. <br /> Пожалуйста, попробуйте другой.";s:7:"success";s:258:"Поздравляем! Ваша регистрация прошла успешно. <br /> <br /> Теперь вы можете войти в систему, используя пароль, который вы вводили при регистрации!";s:11:"editsuccess";s:68:"Информация Вашего профиля обновлена!";s:11:"pwdchangerr";s:109:"Пароли не совпадают. <br /> <br /> Пожалуйста, попробуйте еще раз.";s:16:"pwdchangesuccess";s:43:"Пароль изменен успешно!";s:11:"pwdreseterr";s:139:"Имя пользователя или адрес электронной почты не существуют в наших записях.";s:15:"pwdresetsuccess";s:243:"Пароль успешно сброшен! <br /> <br /> На адрес электронной почты, указанный в вашей учетной записи, было отправлено письмо с новым паролем.";}', 'yes'),
	(665, 'wpmembers_email_newreg', 'a:2:{s:4:"subj";s:37:"Your registration info for [blogname]";s:4:"body";s:256:"Thank you for registering for [blogname]\n\nYour registration information is below.\nYou may wish to retain a copy for your records.\n\nusername: [username]\npassword: [password]\n\nYou may log in here:\n[reglink]\n\nYou may change your password here:\n[user-profile]\n";}', 'no'),
