	(1, 1, '2020-03-10 13:27:19', '2020-03-10 10:27:19', '<!-- wp:paragraph -->\n<p>Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите ее, затем начинайте создавать <a href="https://www.google.ru/">https://www.google.ru/</a></p>\n<!-- /wp:paragraph -->', 'Привет, мир!', '', 'publish', 'open', 'open', '', '%d0%bf%d1%80%d0%b8%d0%b2%d0%b5%d1%82-%d0%bc%d0%b8%d1%80', '', '', '2020-03-10 13:36:28', '2020-03-10 10:36:28', '', 0, 'http://mediaeducation/?p=1', 0, 'post', '', 1),
