	(3, 1, '2020-03-10 13:27:19', '2020-03-10 10:27:19', '<!-- wp:heading --><h2>Кто мы</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Наш адрес сайта: http://mediaeducation.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Какие персональные данные мы собираем и с какой целью</h2><!-- /wp:heading --><!-- wp:heading {"level":3} --><h3>Комментарии</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Если посетитель оставляет комментарий на сайте, мы собираем данные указанные в форме комментария, а также IP адрес посетителя и данные user-agent браузера с целью определения спама.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Анонимизированная строка создаваемая из вашего адреса email ("хеш") может предоставляться сервису Gravatar, чтобы определить используете ли вы его. Политика конфиденциальности Gravatar доступна здесь: https://automattic.com/privacy/ . После одобрения комментария ваше изображение профиля будет видимым публично в контексте вашего комментария.</p><!-- /wp:paragraph --><!-- wp:heading {"level":3} --><h3>Медиафайлы</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Если вы зарегистрированный пользователь и загружаете фотографии на сайт, вам возможно следует избегать загрузки изображений с метаданными EXIF, так как они могут содержать данные вашего месторасположения по GPS. Посетители могут извлечь эту информацию скачав изображения с сайта.</p><!-- /wp:paragraph --><!-- wp:heading {"level":3} --><h3>Формы контактов</h3><!-- /wp:heading --><!-- wp:heading {"level":3} --><h3>Куки</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Если вы оставляете комментарий на нашем сайте, вы можете включить сохранение вашего имени, адреса email и вебсайта в куки. Это делается для вашего удобства, чтобы не заполнять данные снова при повторном комментировании. Эти куки хранятся в течение одного года.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Если у вас есть учетная запись на сайте и вы войдете в неё, мы установим временный куки для определения поддержки куки вашим браузером, куки не содержит никакой личной информации и удаляется при закрытии вашего браузера.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>При входе в учетную запись мы также устанавливаем несколько куки с данными входа и настройками экрана. Куки входа хранятся в течение двух дней, куки с настройками экрана - год. Если вы выберете возможность "Запомнить меня", данные о входе будут сохраняться в течение двух недель. При выходе из учетной записи куки входа будут удалены.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>При редактировании или публикации статьи в браузере будет сохранен дополнительный куки, он не содержит персональных данных и содержит только ID записи отредактированной вами, истекает через 1 день.</p><!-- /wp:paragraph --><!-- wp:heading {"level":3} --><h3>Встраиваемое содержимое других вебсайтов</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Статьи на этом сайте могут включать встраиваемое содержимое (например видео, изображения, статьи и др.), подобное содержимое ведет себя так же, как если бы посетитель зашел на другой сайт.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Эти сайты могут собирать данные о вас, использовать куки, внедрять дополнительное отслеживание третьей стороной и следить за вашим взаимодействием с внедренным содержимым, включая отслеживание взаимодействия, если у вас есть учетная запись и вы авторизовались на том сайте.</p><!-- /wp:paragraph --><!-- wp:heading {"level":3} --><h3>Веб-аналитика</h3><!-- /wp:heading --><!-- wp:heading --><h2>С кем мы делимся вашими данными</h2><!-- /wp:heading --><!-- wp:heading --><h2>Как долго мы храним ваши данные</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Если вы оставляете комментарий, то сам комментарий и его метаданные сохраняются неопределенно долго. Это делается для того, чтобы определять и одобрять последующие комментарии автоматически, вместо помещения их в очередь на одобрение.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Для пользователей с регистрацией на нашем сайте мы храним ту личную информацию, которую они указывают в своем профиле. Все пользователи могут видеть, редактировать или удалить свою информацию из профиля в любое время (кроме имени пользователя). Администрация вебсайта также может видеть и изменять эту информацию.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Какие у вас права на ваши данные</h2><!-- /wp:heading --><!-- wp:paragraph --><p>При наличии учетной записи на сайте или если вы оставляли комментарии, то вы можете запросить файл экспорта персональных данных, которые мы сохранили о вас, включая предоставленные вами данные. Вы также можете запросить удаление этих данных, это не включает данные, которые мы обязаны хранить в административных целях, по закону или целях безопасности.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Куда мы отправляем ваши данные</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Комментарии пользователей могут проверяться автоматическим сервисом определения спама.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Ваша контактная информация</h2><!-- /wp:heading --><!-- wp:heading --><h2>Дополнительная информация</h2><!-- /wp:heading --><!-- wp:heading {"level":3} --><h3>Как мы защищаем ваши данные</h3><!-- /wp:heading --><!-- wp:heading {"level":3} --><h3>Какие принимаются процедуры против взлома данных</h3><!-- /wp:heading --><!-- wp:heading {"level":3} --><h3>От каких третьих сторон мы получаем данные</h3><!-- /wp:heading --><!-- wp:heading {"level":3} --><h3>Какие автоматические решения принимаются на основе данных пользователей</h3><!-- /wp:heading --><!-- wp:heading {"level":3} --><h3>Требования к раскрытию отраслевых нормативных требований</h3><!-- /wp:heading -->', 'Политика конфиденциальности', '', 'draft', 'closed', 'closed', '', 'privacy-policy', '', '', '2020-04-20 02:31:10', '2020-04-19 23:31:10', '', 0, 'http://mediaeducation/?page_id=3', 0, 'page', '', 0),
	(5, 1, '2020-03-10 13:31:05', '2020-03-10 13:31:05', 'The Eysenck Personality Inventory (EPI) measures two pervasive,  independent dimensions of personality,  Extraversion-Introversion and Neuroticism-Stability,  which account for most of the variance in the personality domain. Each form contains 57 "Yes-No" items with no repetition of items. The inclusion of a falsification scale provides for the detection of response distortion. The traits measured are Extraversion-Introversion and Neuroticism.<!--more--> When you fill out Eysenck’s Personality Inventory (EPI) you get three scores.\r\n<ul>\r\n	<li>The ‘lie score’ is out of 9. It measures how socially desirable you are trying to be in your answers.Those who score 5 or more on this scale are probably trying to make themselves look good and are not being totally honest in their responses.</li>\r\n	<li>The ‘E score’ is out of 24 and measures how much of an extrovert you are.</li>\r\n	<li>The ‘N score’ is out of 24 and measures how neurotic you are.</li>\r\n</ul>\r\nTo interpret the scores,  your E score and your N score are plotted on a graph from which you can read your personality characteristics. The nearer the outside of the circle you are,  the more marked are the personality traits. Please note that the EPI is a very simplistic type of personality measurement scale,  so if you have come out as a personality that does not match what you thought before you took the test,  you are probably right and the test is probably wrong!\r\n\r\n<img src="http://mediaeducation/wp-content/plugins/wp-testing/img/EPI-scales.png" alt="EPI scales" />\r\n<h2>Instructions</h2>\r\nHere are some questions regarding the way you behave,  feel and act. Each question has radio buttons to answer YES or NO. Try to decide whether YES or NO represents your usual way of acting or feeling. Then check those radio named YES or NO. Work quickly,  and don’t spend too much time over any question,  we want your first reaction,  not a long drawn-out thought process. The whole questionnaire shouldn’t take more than a few minutes. Be sure not to omit any questions. Start now,  work quickly and remember to answer every question. There are no right or wrong answers,  and this isn’t a test of intelligence or ability,  but simply a measure of the way you behave.\n\n<p style="color: gray; font-size: 70%; text-align: right;">This test is a demonstration of <a href="http://apsiholog.ru/psychological-tests/">psychological tests</a> plugin.</p>', 'Eysenck’s Personality Inventory (EPI) (Extroversion/Introversion)', '', 'publish', 'closed', 'closed', '', 'eysencks-personality-inventory-epi-extroversionintroversion', '', '', '2020-03-10 13:31:05', '2020-03-10 13:31:05', '', 0, '3f6e6708-62ba-11ea-8312-dc0ea19a00ed', 0, 'wpt_test', '', 0),
