	(290, 1, '2020-04-29 21:43:05', '2020-04-29 18:43:05', '<label> Ваше имя\r\n    [text* your-name] </label>\r\n\r\n<label> Ваша электронная почта\r\n    [email* your-email] </label>\r\n\r\n<label> Тема\r\n    [text your-subject] </label>\r\n\r\n<label> Сообщение\r\n    [textarea your-message] </label>\r\n\r\n[submit "Отправить"]\n1\n"[your-subject]"\nasdasd <wordpress@mediaeducation.com>\nseva.kamenovsky63@gmail.com\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on  (http://mediaeducation)\nReply-To: [your-email]\n\n\n\n\n"[your-subject]"\n<wordpress@mediaeducation>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on  (http://mediaeducation)\nReply-To: 79115906718@yandex.ru\n\n\n\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.\nThe date format is incorrect.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nThe e-mail address entered is invalid.\nThe URL is invalid.\nThe telephone number is invalid.', 'Контактная форма', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2020-04-29 22:19:04', '2020-04-29 19:19:04', '', 0, 'http://mediaeducation/?post_type=wpcf7_contact_form&#038;p=290', 0,