INSERT INTO `wp_term_taxonomy` (`term_taxonomy_id`, `term_id`, `taxonomy`, `description`, `parent`, `count`) VALUES
	(1, 1, 'category', '', 0, 1),
	(2, 2, 'wpt_answer', '', 0, 2),
	(3, 3, 'wpt_answer', '', 0, 2),
	(4, 4, 'wpt_scale', 'Extraversion is characterized by being outgoing,  talkative,  high on positive affect (feeling good),  and in need of external stimulation. According to Eysenck\'s arousal theory of extraversion,  there is an optimal level of cortical arousal,  and performance deteriorates as one becomes more or less aroused than this optimal level. Arousal can be measured by skin conductance,  brain waves or sweating. At very low and very high levels of arousal,  performance is low,  but at a better mid-level of arousal,  performance is maximized.\r\n\r\nExtraverts,  according to Eysenck\'s theory,  are chronically under-aroused and bored and are therefore in need of external stimulation to bring them up to an optimal level of performance. About 16 percent of the population tend to fall in this range.\r\n\r\nIntroverts,  on the other hand,  (also about 16 percent of the population) are chronically over-aroused and jittery and are therefore in need of peace and quiet to bring them up to an optimal level of performance.\r\n\r\nMost people (about 68 percent of the population) fall in the midrange of the extraversion/introversion continuum,  an area referred to as ambiversion.', 0, 1),
	(5, 5, 'wpt_scale', 'Neuroticism or emotionality is characterized by high levels of negative affect such as depression and anxiety. Neuroticism,  according to Eysenck\'s theory,  is based on activation thresholds in the sympathetic nervous system or visceral brain. This is the part of the brain that is responsible for the fight-or-flight response in the face of danger. Activation can be measured by heart rate,  blood pressure,  cold hands,  sweating and muscular tension (especially in the forehead).\r\n\r\nNeurotic people — who have low activation thresholds,  and unable to inhibit or control their emotional reactions,  experience negative affect (fight-or-flight) in the face of very minor stressors — are easily nervous or upset.\r\n\r\nEmotionally stable people — who have high activation thresholds and good emotional control,  experience negative affect only in the face of very major stressors — are calm and collected under pressure.', 0, 1),
	(6, 6, 'wpt_scale', 'It measures how socially desirable you are trying to be in your answers. Those who score 5 or more on this scale are probably trying to make themselves look good and are not being totally honest in their responses.', 0, 1),
	(7, 7, 'wpt_result', 'The sanguine temperament is traditionally associated with air. People with this temperament tend to be lively, sociable, carefree, talkative, and pleasure-seeking. They may be warm-hearted and optimistic. They can make new friends easily, be imaginative and artistic, and often have many ideas. They can be flighty and changeable; thus sanguine personalities may struggle with following tasks all the way through and be chronically late or forgetful.\n\nPedagogically, they can be best reached through awakening their love for a subject and admiration of people.', 0, 1),
	(8, 8, 'wpt_result', 'The choleric temperament is traditionally associated with fire. People with this temperament tend to be egocentric and extroverted. They may be excitable, impulsive, and restless, with reserves of aggression, energy, and/or passion, and try to instill that in others.\n\nThey tend to be task-oriented people and are focused on getting a job done efficiently; their motto is usually "do it now." They can be ambitious, strong-willed and like to be in charge. They can show leadership, are good at planning, and are often practical and solution-oriented. They appreciate receiving respect and esteem for their work.\n\nPedagogically, they can be best reached through mutual respect and appropriate challenges that recognize their capacities.', 0, 1),
	(9, 9, 'wpt_result', 'The melancholic temperament is traditionally associated with the element of earth. People with this temperament may appear serious, introverted, cautious or even suspicious. They can become preoccupied with the tragedy and cruelty in the world and are susceptible to depression and moodiness. They may be focused and conscientious. They often prefer to do things themselves, both to meet their own standards and because they are not inherently sociable.\n\nPedagogically, they can be best met by awakening their sympathy for others and the suffering of the world.', 0, 1),
	(10, 10, 'wpt_result', 'The phlegmatic temperament is traditionally associated with water. People with this temperament may be inward and private, thoughtful, reasonable, calm, patient, caring, and tolerant. They tend to have a rich inner life, seek a quiet, peaceful atmosphere, and be content with themselves. They tend to be steadfast, consistent in their habits, and thus steady and faithful friends.\n\nPedagogically, their interest is often awakened by experiencing others\' interest in a subject.\n\nPeople of this temperament may appear somewhat ponderous or clumsy. Their speech tends to be slow or appear hesitant.', 0, 1),
	(11, 11, 'wpt_result', '', 0, 1),
	(12, 12, 'wpt_result', '', 0, 1),
	(13, 13, 'category', '', 0, 4),
	(14, 14, 'portfolio_cat', '', 0, 8),
	(17, 17, 'nav_menu', '', 0, 8);
