INSERT INTO `wp_t_questions` (`question_id`, `test_id`, `question_title`) VALUES
	(1, 5, 'Do you often long for excitement?'),
	(2, 5, 'Do you often need understanding friends to cheer you up?'),
	(3, 5, 'Are you usually carefree?'),
	(4, 5, 'Do you find it very hard to take no for an answer?'),
	(5, 5, 'Do you stop and think things over before doing anything?'),
	(6, 5, 'If you say you will do something do you always keep your promise, no matter how inconvenient it might be to do so?'),
	(7, 5, 'Do your moods go up and down?'),
	(8, 5, 'Do you generally do and say things quickly without stopping to think?'),
	(9, 5, 'Do you ever feel ‘just miserable’ for no good reason?'),
	(10, 5, 'Would you do almost anything for a dare?'),
	(11, 5, 'Do you suddenly feel shy when you want to talk to an attractive stranger?'),
	(12, 5, 'Once in a while do you lose your temper and get angry?'),
	(13, 5, 'Do you often do things on the spur of the moment?'),
	(14, 5, 'Do you often worry about things you should have done or said?'),
	(15, 5, 'Generally do you prefer reading to meeting people?'),
	(16, 5, 'Are your feelings rather easily hurt?'),
	(17, 5, 'Do you like going out a lot?'),
	(18, 5, 'Do you occasionally have thoughts and ideas that you would not like other people to know about?'),
	(19, 5, 'Are you sometimes bubbling over with energy and sometimes very sluggish?'),
	(20, 5, 'Do you prefer to have few but special friends?'),
	(21, 5, 'Do you daydream a lot?'),
	(22, 5, 'When people shout at you do you shout back?'),
	(23, 5, 'Are you often troubled about feelings of guilt?'),
	(24, 5, 'Are all your habits good and desirable ones?'),
	(25, 5, 'Can you usually let yourself go and enjoy yourself a lot at a lively party?'),
	(26, 5, 'Would you call yourself tense or ‘highly strung’?'),
	(27, 5, 'Do other people think of you as being very lively?'),
	(28, 5, 'After you have done something important, do you come away feeling you could have done better?'),
	(29, 5, 'Are you mostly quiet when you are with other people?'),
	(30, 5, 'Do you sometimes gossip?'),
	(31, 5, 'Do ideas run through your head so that you cannot sleep?'),
	(32, 5, 'If there is something you want to know about, would you rather look it up in a book than talk to someone about it?'),
	(33, 5, 'Do you get palpitations or thumping in your heart?'),
	(34, 5, 'Do you like the kind of work that you need to pay close attention to?'),
	(35, 5, 'Do you get attacks of shaking or trembling?'),
	(36, 5, 'Would you always declare everything at customs, even if you knewyou could never be found out?'),
	(37, 5, 'Do you hate being with a crowd who play jokes on one another?'),
	(38, 5, 'Are you an irritable person?'),
	(39, 5, 'Do you like doing things in which you have to act quickly?'),
	(40, 5, 'Do you worry about awful things that might happen?'),
	(41, 5, 'Are you slow and unhurried in the way you move?'),
	(42, 5, 'Have you ever been late for an appointment or work?'),
	(43, 5, 'Do you have many nightmares?'),
	(44, 5, 'Do you like talking to people so much that you never miss a chance of talking to a stranger?'),
	(45, 5, 'Are you troubled by aches and pains?'),
	(46, 5, 'Would you be very unhappy if you could not see lots of people most of the time?'),
	(47, 5, 'Would you call yourself a nervous person?'),
	(48, 5, 'Of all the people you know, are there some whom you definitely do not like?'),
	(49, 5, 'Would you say that you were fairly self-confident?'),
	(50, 5, 'Are you easily hurt when people find fault with you or your work?'),
	(51, 5, 'Do you find it hard to really enjoy yourself at a lively party?'),
	(52, 5, 'Are you troubled by feelings of inferiority?'),
	(53, 5, 'Can you easily get some life into a dull party?'),
	(54, 5, 'Do you sometimes talk about things you know nothing about?'),
	(55, 5, 'Do you worry about your health?'),
	(56, 5, 'Do you like playing pranks on others?'),
	(57, 5, 'Do you suffer from sleeplessness?'),
	(58, 7, 'Тест'),
	(59, 7, 'Тест 2');
